import React, { Component } from 'react'

export default class login extends Component {

    state = {
        usuario:[
        ]
    }

    render() {
        return (
            <div>
                <h1>Hola</h1>
                <input
                                type="text"
                                className="form-control"
                                placeholder="Title"
                                onChange={this.onInputChange}
                                name="title"
                                value={this.state.title}
                                required />
            </div>
        )
    }
}
